"use strict";(self.webpackChunklearn_data=self.webpackChunklearn_data||[]).push([[2456],{9874:(s,i)=>{i.A=(s,i)=>{const a=s.__vccOpts||s;for(const[s,e]of i)a[s]=e;return a}},345:(s,i,a)=>{a.r(i),a.d(i,{comp:()=>h,data:()=>p});var e=a(2360);const t=(0,e.Fv)('<h1 id="_2023年终总结" tabindex="-1"><a class="header-anchor" href="#_2023年终总结"><span>2023年终总结</span></a></h1><p>去了太原到了北京。其实公司也有很多闲的时候，但是确实看不到提升看不到希望。</p><p>一方面也是自身驱动力还是太有限了，年少轻狂裸辞了一次。这个话题还可单独开一贴五味杂陈。</p><h2 id="太原" tabindex="-1"><a class="header-anchor" href="#太原"><span>| 太原</span></a></h2><blockquote><p>第一次出差相当于常驻，后因住房冲突喜得优化回长。</p><p><strong>心情如上第一次：忐忑 up+++ watch 会监测到心跳异常的那种</strong></p></blockquote><p>只短暂呆了 7 天，充分再享受了一次北方的冬天 + 地暖，住在汾河边工作点在商场写字楼。</p><p>只去了博物馆，其实山西应该还有很多好玩的没去玩属实浪费了　　现在回想也可能是自己初出社会的忐忑吧</p><div class="language-html line-numbers-mode" data-highlighter="shiki" data-ext="html" data-title="html" style="--shiki-light:#24292e;--shiki-dark:#abb2bf;--shiki-light-bg:#fff;--shiki-dark-bg:#282c34;"><pre class="shiki shiki-themes github-light one-dark-pro vp-code"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#ABB2BF;">&lt;</span><span style="--shiki-light:#22863A;--shiki-dark:#E06C75;">video</span><span style="--shiki-light:#6F42C1;--shiki-dark:#D19A66;"> width</span><span style="--shiki-light:#24292E;--shiki-dark:#ABB2BF;">=</span><span style="--shiki-light:#032F62;--shiki-dark:#98C379;">&quot;320&quot;</span><span style="--shiki-light:#6F42C1;--shiki-dark:#D19A66;"> height</span><span style="--shiki-light:#24292E;--shiki-dark:#ABB2BF;">=</span><span style="--shiki-light:#032F62;--shiki-dark:#98C379;">&quot;240&quot;</span><span style="--shiki-light:#6F42C1;--shiki-dark:#D19A66;"> controls</span><span style="--shiki-light:#24292E;--shiki-dark:#ABB2BF;">&gt;</span></span>\n<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#ABB2BF;">    &lt;</span><span style="--shiki-light:#22863A;--shiki-dark:#E06C75;">source</span><span style="--shiki-light:#6F42C1;--shiki-dark:#D19A66;"> src</span><span style="--shiki-light:#24292E;--shiki-dark:#ABB2BF;">=</span><span style="--shiki-light:#032F62;--shiki-dark:#98C379;">&quot;https://images.zzq8.cn/video/First%20business%20trip%20-%20Sad%20%3A%20%28.m4v&quot;</span><span style="--shiki-light:#6F42C1;--shiki-dark:#D19A66;"> type</span><span style="--shiki-light:#24292E;--shiki-dark:#ABB2BF;">=</span><span style="--shiki-light:#032F62;--shiki-dark:#98C379;">&quot;video/m4v&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#ABB2BF;">&gt;</span></span>\n<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#ABB2BF;">&lt;/</span><span style="--shiki-light:#22863A;--shiki-dark:#E06C75;">video</span><span style="--shiki-light:#24292E;--shiki-dark:#ABB2BF;">&gt;</span></span></code></pre><div class="line-numbers" aria-hidden="true" style="counter-reset:line-number 0;"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div>',8),n=(0,e.Fv)('<p><video src="https://images.zzq8.cn/video/First%20business%20trip%20-%20Sad%20%3A%20%28.m4v"></video></p><h2 id="北京" tabindex="-1"><a class="header-anchor" href="#北京"><span>| 北京</span></a></h2><h3 id="_1-乐" tabindex="-1"><a class="header-anchor" href="#_1-乐"><span>1.乐</span></a></h3><blockquote><p>开阔了眼界！包住每天和同事一起滴滴去，下午没什么事情的话 5. 大家就都走了，我就一般搞自己的东西等同事一起滴滴回。</p></blockquote><h4 id="_1-1-业务开拓" tabindex="-1"><a class="header-anchor" href="#_1-1-业务开拓"><span>1.1.业务开拓</span></a></h4><p>驻场央企负责 WMS 每周大概率都会有外国人来参观，央企的人跑到库房对接问题 ~ 系统的客户也很多在外国，有很长一段时间一直和驻<strong>安哥拉</strong>的CATIC人员交互对接系统问题（但是时差会让我常加班），还有就是中东地区的<strong>阿联酋</strong>也一样。甚至公司让我去缅甸出差（拒绝然后落到项目经理头上）业务线还有巴基斯坦。。。</p><ul><li>这个央企有点级别的基本都有在国外常驻过，全硕士往上好像还要关系。</li><li>第一次听说 7 险 2 金</li></ul><h4 id="_1-2-帝都开拓" tabindex="-1"><a class="header-anchor" href="#_1-2-帝都开拓"><span>1.2.帝都开拓</span></a></h4><p>**工作日：**在央企体验体制文化（他们下班都溜的好早的），每天早中在央企吃自助餐胡吃海塞</p><p>**周末：**去了长城、天安门骑行、前门、天坛</p><p>ps：帝都公交车上车要刷一次，下车还要刷一次和长沙不同（应该是行程长的原因）</p><h3 id="_2-悲" tabindex="-1"><a class="header-anchor" href="#_2-悲"><span>2.悲</span></a></h3><blockquote><p>其实不是很喜欢长期呆北京，住在5环边。 觉得大家都好累看过等公交车等画面感觉都不容易</p></blockquote><p>在北京被臭虫咬</p><p>虽然北方的食物很好吃还又分量多但是心里也是不愿呆的</p><h2 id="体悟" tabindex="-1"><a class="header-anchor" href="#体悟"><span>| 体悟</span></a></h2><p>危机感要有！</p><p>两个总的建议 要有危机感，要自信 二十岁前不要懒，三十岁前不要怕，三十岁后不要悔 要想远一点</p><p>我觉得很有道理，并不是说什么 PUA 就是单纯觉得很对：</p><p>罗总：要有危机感</p><p>刘总：我觉得你可以自信一点（辞职对话）</p>',21),l={},h=(0,a(9874).A)(l,[["render",function(s,i){const a=(0,e.g2)("ArtPlayer");return(0,e.uX)(),(0,e.CE)("div",null,[t,(0,e.bF)(a,{src:"https://images.zzq8.cn/video/First%20business%20trip%20-%20Sad%20%3A%20%28.m4v"}),n])}]]),p=JSON.parse('{"path":"/posts/personal/2023%E5%B9%B4%E7%BB%88%E6%80%BB%E7%BB%93.html","title":"2023年终总结","lang":"zh-CN","frontmatter":{"title":"2023年终总结","icon":"fa-solid fa-face-sad-cry","order":1,"category":["打工日寄"],"tag":["年终总结"],"feed":false,"seo":false,"head":[]},"headers":[{"level":2,"title":"| 太原","slug":"太原","link":"#太原","children":[]},{"level":2,"title":"| 北京","slug":"北京","link":"#北京","children":[{"level":3,"title":"1.乐","slug":"_1-乐","link":"#_1-乐","children":[]},{"level":3,"title":"2.悲","slug":"_2-悲","link":"#_2-悲","children":[]}]},{"level":2,"title":"| 体悟","slug":"体悟","link":"#体悟","children":[]}],"git":{"createdTime":1719648865000,"updatedTime":1720936330000,"contributors":[{"name":"MiniPC","email":"1024zzq@gmail.com","commits":3},{"name":"Fighting","email":"1024zzq@gmail.com","commits":1}]},"readingTime":{"minutes":2.53,"words":760},"filePathRelative":"_posts/personal/2023年终总结.md","localizedDate":"2024年6月29日"}')}}]);